import React, { Component } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

export default class Course extends Component {
  render() {
    return(
        <Container fluid={true}>
            <Row>
            <Col sm="9">Hello</Col>
            <Col sm="3">Hello</Col>
            </Row>
        </Container>
    );
  }
}
